import { useState } from "react";
import { Card, CardContent } from "@/components/ui/card";
import { Input } from "@/components/ui/input";
import { Button } from "@/components/ui/button";
import { Eye, EyeOff, Check } from "lucide-react";

export default function LoginPage() {
  const [showPassword, setShowPassword] = useState(false);

  const handleSubmit = (e: React.FormEvent) => {
    e.preventDefault();
    // ✅ Add login logic here
  };

  return (
    <div className="min-h-screen flex items-center justify-center bg-gradient-to-r from-blue-50 via-white to-purple-50 px-6">
      <Card className="w-full max-w-6xl grid md:grid-cols-2 shadow-2xl rounded-2xl overflow-hidden">
        
        {/* Left Section */}
        <div className="flex flex-col items-center justify-center bg-white px-10 py-12 text-center">
          <img src="/assets/UpToSkills_Logo.svg" alt="Logo" className="h-14 mb-6" />

          <h1 className="text-4xl font-extrabold leading-snug">
            <span className="bg-gradient-to-r from-blue-500 to-purple-500 bg-clip-text text-transparent">
              AI Learning
            </span>{" "}
            <span className="text-black">Platform</span>
          </h1>

          <p className="text-gray-600 mt-4 text-lg leading-relaxed max-w-sm">
            Unlock the future of education with{" "}
            <span className="font-semibold text-blue-500">AI-powered courses</span>{" "}
            designed to accelerate your learning journey.
          </p>

          <img
            src="/assets/login_psge_img.jpg"
            alt="AI Illustration"
            className="mt-10 w-64 rounded-xl shadow-lg"
          />
        </div>

        {/* Right Side (Login Form) */}
        <CardContent className="flex items-center justify-center bg-white">
          <div className="w-full max-w-md bg-white p-6">
            
            {/* Heading */}
            <div className="text-center mb-6">
              <h2 className="text-3xl font-extrabold text-gray-900">
                Welcome Back
              </h2>
              <p className="text-gray-500 text-sm">Access your AI learning journey</p>
            </div>

            {/* Form */}
            <form className="space-y-5" onSubmit={handleSubmit}>
              <Input type="email" name="email" placeholder="Enter your email address here" required />

              <div className="relative">
                <Input
                  type={showPassword ? "text" : "password"}
                  name="password"
                  placeholder="Password"
                  required
                  className="pr-10"
                />
                <button
                  type="button"
                  className="absolute right-3 top-3 text-gray-500"
                  onClick={() => setShowPassword(!showPassword)}
                >
                  {showPassword ? <EyeOff size={20} /> : <Eye size={20} />}
                </button>
              </div>

              <div className="flex items-center justify-between text-sm">
                <label className="flex items-center space-x-2 text-gray-600">
                  <input type="checkbox" className="rounded" />
                  <span>Keep me logged in</span>
                </label>
                <a href="/forgot-password" className="text-blue-600 hover:underline">
                  Forgot Password?
                </a>
              </div>

              <Button className="w-full rounded-full bg-gradient-to-r from-blue-500 to-purple-500 text-white text-lg p-3">
                Log In
              </Button>
            </form>

            {/* Divider */}
            <div className="flex items-center my-6">
              <hr className="flex-grow border-gray-300" />
              <span className="px-3 text-gray-400 text-sm">Or</span>
              <hr className="flex-grow border-gray-300" />
            </div>

            {/* Social Logins */}
            <div className="space-y-3">
              <button className="w-full flex items-center justify-center gap-3 rounded-full py-3 bg-white border shadow-sm hover:shadow-md">
                <img src="/assets/google_icon.svg" alt="Google" className="h-5 w-5" />
                <span className="font-medium text-gray-700">Sign in with Google</span>
              </button>

              <button className="w-full flex items-center justify-center gap-3 rounded-full py-3 bg-white border shadow-sm hover:shadow-md">
                <img src="/assets/apple_icon.svg" alt="Apple" className="h-5 w-5" />
                <span className="font-medium text-gray-700">Sign in with Apple</span>
              </button>
            </div>

            {/* Switch Link */}
            <p className="text-center text-gray-600 mt-6 text-sm">
              Don’t have an account?{" "}
              <a href="/signup" className="text-blue-600 font-semibold hover:underline">
                Sign Up
              </a>
            </p>
          </div>
        </CardContent>
      </Card>
    </div>
  );
}


